import React from "react";

function HomePage() {
    return(
        <>  <LoginPanel>
            <h1>Zaloguj się</h1>
            <label>Login
                <input type={"text"} name={"login"}/>
            </label>
            <label>Hasło
                <input type={"password"} name={"password"}/>
            </label>
            </LoginPanel>
        </>
    )
}
export default HomePage;
